                new Movie {Id = 18, DirectorId = 16, GenreId = 1, Title = "This Is the End", Description = "In Hollywood, actor James Franco is throwing a party with a slew of celebrity pals. Among those in attendance are his buddies Jonah Hill, Seth Rogen, Jay Baruchel, Danny McBride and Craig Robinson. Suddenly, an apocalypse of biblical proportions erupts, causing untold carnage among Tinseltown's elite and trapping Franco's party in his home. As the world they knew disintegrates outside, cabin fever and dwindling supplies threaten to tear the six friends apart.", Year = 2013, IsForeign = false, Length = "107min", Rating = "3/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Netflix, Vudu, Apple TV, Google Play Movies & TV, Amazon Prime", },
                new Movie {Id = 19, DirectorId = 15, GenreId = 2, Title = "40 Year Old Virgin", Description = "Andy Stitzer (Steve Carell) is an amiable single guy who works at a big-box store. Living alone, 40-year-old Andy spends his free time playing video games and curating his action-figure collection. Despite his age, Andy has never had sex, so his friends, including the laid-back David (Paul Rudd), push Andy towards losing his virginity. While attempting to get over his awkwardness around female customers, Andy meets local shop owner Trish (Catherine Keener), and they begin a tentative romance.", Year = 2005, IsForeign = false, Length = "116min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Vudu, Apple TV, Google Play Movies & TV, Amazon Prime" },
