                new Movie {Id = 35, DirectorId = 27, GenreId = 1, Title = "Blazing Saddles", Description = "In this satirical take on Westerns, crafty railroad worker Bart (Cleavon Little) becomes the first black sheriff of Rock Ridge, a frontier town about to be destroyed in order to make way for a new railroad. Initially, the people of Rock Ridge harbor a racial bias toward their new leader. However, they warm to him after realizing that Bart and his perpetually drunk gunfighter friend (Gene Wilder) are the only d", Year = 1974, IsForeign = false, Length = "93min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Showtime, Hulu, Fubu, Paramount, Peacock,Sling, Amazon Prime, Hulu, Redbox, The Roku Channel, Google Play Movies & TV" },
                new Movie {Id = 36, DirectorId = 28, GenreId = 1, Title = "The Hangover", Description = "Two days before his wedding, Doug (Justin Bartha) and three friends (Bradley Cooper, Ed Helms, Zach Galifianakis) drive to Las Vegas for a wild and memorable stag party. In fact, when the three groomsmen wake up the next morning, they can't remember a thing; nor can they find Doug. With little time to spare, the three hazy pals try to re-trace their steps and find Doug so they can get him back to Los Angeles in time to walk down the aisle.", Year = 2009, IsForeign = false, Length = "96min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Vudu,  Amazon Prime, Hulu, Redbox, The Roku Channel, Google Play Movies & TV" },
