                new Movie {Id = 85, DirectorId = 60, GenreId = 3, Title = "Friday", Description = "yadadad", Year = 2013, IsForeign = false, Length = "133min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Netflix, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV," },
                new Movie {Id = 86, DirectorId = 61, GenreId = 3, Title = "Friday", Description = "\"The greatest trick the devil ever pulled was convincing the world he didn't exist,\" says con man Kint (Kevin Spacey), drawing a comparison to the most enigmatic criminal of all time, Keyser Soze. Kint attempts to convince the feds that the mythic crime lord not only exists, but is also responsible for drawing Kint and his four partners into a multi-million dollar heist that ended with an explosion in San Pedro Harbor - leaving few survivors.", Year = 1995, IsForeign = false, Length = "106min", Rating = "4.2/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Tubi, Pluto" },
                new Movie {Id = 87, DirectorId = 62, GenreId = 3, Title = "Basic Instinct", Description = "The mysterious Catherine Tramell (Sharon Stone), a beautiful crime novelist, becomes a suspect when she is linked to the brutal death of a rock star. Investigated by homicide detective Nick Curran (Michael Douglas), Catherine seduces him into an intense relationship. Meanwhile, the murder case becomes increasingly complicated when more seemingly connected deaths occur and Nick's psychologist and lover, Beth Garner (Jeanne Tripplehorn), appears to be another suspect.", Year = 1992, IsForeign = false, Length = "128min", Rating = "3/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Roku Channel, Paramount,  Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Max, Hulu, Showtime, FuboTV, Redbox, Sling TV" },
                new Movie {Id = 88, DirectorId = 63, GenreId = 3, Title = "Mystic River", Description = "When the daughter (Emmy Rossum) of ex-con Jimmy Marcus (Sean Penn) is murdered, two of his childhood friends from the neighborhood are involved. Dave (Tim Robbins), a blue-collar worker, was the last person to see her alive, while Sean (Kevin Bacon), a homicide detective, is heading up the case. As Sean proceeds with his investigation, Jimmy conducts one of his own through neighborhood contacts. Eventually, Jimmy suspects Dave is the culprit and considers taking the law into his own hands.", Year = 2003, IsForeign = false, Length = "127min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube" },
                new Movie {Id = 89, DirectorId = 47, GenreId = 3, Title = "The Game", Description = "Nicholas Van Orton (Michael Douglas) is a successful banker who keeps mostly to himself. When his estranged brother Conrad (Sean Penn) returns on his birthday with an odd gift -- participation in a personalized, real-life game -- Nicholas reluctantly accepts. Initially harmless, the game grows increasingly personal, and Orton begins to fear for his life as he eludes agents from the mysterious game's organizers. With no one left to trust and his money gone, Orton must find answers for himself.", Year = 1997, IsForeign = false, Length = "109min", Rating = "3.5/5", Rated = "R", ImgUrl = "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTpXForETRTNt2fH-8hsTDk9qaAQZXP4U_ivg&usqp=CAU", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube" },
                new Movie {Id = 90, DirectorId = 64, GenreId = 3, Title = "Sherlock Holmes: A Game of Shadows", Description = "When Austria's crown prince is found dead, evidence seems to point to suicide. However, detective Sherlock Holmes (Robert Downey Jr.) deduces that the prince was murdered and that the crime is but a piece of a puzzle designed by an evil genius named Moriarty (Jared Harris). Holmes and his friend Dr. Watson (Jude Law), who are accompanied by a Gypsy (Noomi Rapace) whose life Holmes saved, chase Moriarty across Europe in the hope that they can thwart his plot before it can come to fruition.", Year = 2013, IsForeign = false, Length = "109min", Rating = "3/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube" },
                new Movie {Id = 91, DirectorId = 65, GenreId = 3, Title = "Clue", Description = "Six blackmail victims are invited to an isolated mansion by a man who knows a dark secret from each of their pasts. On arrival, each is given a pseudonym drawn from Cluedo before being introduced to the blackmailer. Each is handed a weapon, at which point the lights are switched off and the blackmailer is killed. Can the guests uncover the murderer before they all become victims?", Year = 1985, IsForeign = false, Length = "97min", Rating = "3.5/5", Rated = "PG", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Amazon Prime, Vudu, Google Play Movies & TV, Roku Chanel, Philo" },
                new Movie {Id = 92, DirectorId = 66, GenreId = 3, Title = "The Girl on the Train", Description = "Commuter Rachel Watson (Emily Blunt) catches daily glimpses of a seemingly perfect couple, Scott and Megan, from the window of her train. One day, Watson witnesses something shocking unfold in the backyard of the strangers' home. Rachel tells the authorities what she thinks she saw after learning that Megan is now missing and feared dead. Unable to trust her own memory, the troubled woman begins her own investigation, while police suspect that Rachel may have crossed a dangerous line.", Year = 2016, IsForeign = false, Length = "112min", Rating = "2.2/5", Rated = "R", ImgUrl = "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQJPpgCaOsLmMMrJSzlgo45r4OHJgxDGS9Fww&usqp=CAU", SteamingOn = "TBS, TNT, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube" },
                new Movie {Id = 93, DirectorId = 1, GenreId = 1, Title = "The Woman in the Window", Description = "Agoraphobic Dr. Anna Fox witnesses something she shouldn't while keeping tabs on the Russell family, the seemingly picture perfect clan that lives across the way.", Year = 2021, IsForeign = false, Length = "100min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Netflix" },
                new Movie {Id = 94, DirectorId = 68, GenreId = 3, Title = "The Invisible Guest", Description = "A young businessman wakes up in a locked hotel room next to the body of his dead lover. He hires a prestigious lawyer to defend him, and over the course of one night, they work together to find out what happened.", Year = 2016, IsForeign = false, Length = "103min", Rating = "4/5", Rated = "NC-17", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, FlixLatino, Google Play Movies & TV, YouTube," },
                new Movie {Id = 95, DirectorId = 69, GenreId = 3, Title = "Tinker Tailor Soldier Spy", Description = "In 1970s England the head of MI6, Control (John Hurt), dispatches an agent (Mark Strong) to meet with a Hungarian general who knows the identity of a Soviet spy in the organization's ranks. However, the mission goes wrong, and the general dies before he can reveal the information. Undersecretary Oliver Lacon (Simon McBurney) calls veteran agent George Smiley (Gary Oldman) back from forced retirement to ferret out the mole and stop the flow of vital British secrets to the Russians.", Year = 2011 , IsForeign = false, Length = "127min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox" },
                new Movie {Id = 96, DirectorId = 70, GenreId = 3, Title = "Gosford Park", Description = "Robert Altman, one of America's most distinctive filmmakers, journeys to England for the first time to create a unique film mosaic with an outstanding ensemble cast. Set in the 1930's, \"Gosford Park\" brings a group of pretentious rich and famous together for a weekend of relaxation at a hunting resort. But when a murder occurs, each one of these interesting characters becomes a suspect.", Year = 2001, IsForeign = false, Length = "137min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox," },
                new Movie {Id = 97, DirectorId = 48, GenreId = 3, Title = "Rope", Description = "Just before hosting a dinner party, Philip Morgan (Farley Granger) and Brandon Shaw (John Dall) strangle a mutual friend to death with a piece of rope, purely as a Nietzsche-inspired philosophical exercise. Hiding the body in a chest upon which they then arrange a buffet dinner, the pair welcome their guests, including the victim's oblivious fiancée (Joan Chandler) and the college professor (James Stewart) whose lectures inadvertently inspired the killing.", Year = 1948, IsForeign = false, Length = "103min", Rating = "4.1/5", Rated = "PG", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox," },
                new Movie {Id = 98, DirectorId = 71, GenreId = 11, Title = "Primal Fear", Description = "Defense attorney Martin Vail takes on jobs for money and prestige rather than any sense of the greater good. His latest case involves an altar boy, accused of brutally murdering the archbishop of Chicago. Vail finds himself up against his ex-pupil and ex-lover, but as the case progresses and the Church's dark secrets are revealed, Vail finds that what appeared a simple case takes on a darker, more dangerous aspect.", Year = 2010, IsForeign = false, Length = "130min", Rating = "3.5/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Paramount,  Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox, Pluto" },
                new Movie {Id = 99, DirectorId = 72, GenreId = 3, Title = "Murder on the Orient Express", Description = "Having concluded a case, detective Hercule Poirot (Albert Finney) settles into what he expects will be a relaxing journey home aboard the Orient Express. But when an unpopular billionaire is murdered en route, Poirot takes up the case, and everyone on board the famous train is a suspect. Using an avalanche blocking the tracks to his advantage, Poirot gradually realizes that many of the passengers have revenge as a motive, and he begins to home in on the culprit.", Year = 1974, IsForeign = false, Length = "131min", Rating = "5/5", Rated = "PG", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Roku Channel, Paramount,  Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, FuboTV, ABC" },
                new Movie {Id = 100, DirectorId = 1, GenreId = 3, Title = "Murder on the Orient Express", Description = "A lavish trip through Europe quickly unfolds into a race against time to solve a murder aboard a train. When an avalanche stops the Orient Express dead in its tracks, the world's greatest detective -- Hercule Poirot -- arrives to interrogate all passengers and search for clues before the killer can strike again.", Year = 2017, IsForeign = false, Length = "103min", Rating = "3/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox, Hulu," },
                new Movie {Id = 101, DirectorId = 73, GenreId = 3, Title = "Knives Out", Description = "The circumstances surrounding the death of crime novelist Harlan Thrombey are mysterious, but there's one thing that renowned Detective Benoit Blanc knows for sure -- everyone in the wildly dysfunctional Thrombey family is a suspect. Now, Blanc must sift through a web of lies and red herrings to uncover the truth.", Year = 2019, IsForeign = false, Length = "130min", Rating = "4/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube," },
                new Movie {Id = 102, DirectorId = 73, GenreId = 3, Title = "Glass Onion: A Knives Out Mystery", Description = "Tech billionaire Miles Bron invites his friends for a getaway on his private Greek island. When someone turns up dead, Detective Benoit Blanc is put on the case", Year = 1978, IsForeign = false, Length = "103min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Netflix" },
                new Movie {Id = 103, DirectorId = 74, GenreId = 3, Title = "8mm", Description = "Private detective Tom Welles (Nicolas Cage) lives a normal life with his wife (Catherine Keener) and young daughter, until he receives a startling new case. A widow named Mrs. Christian (Myra Carter) has found what appears to be a snuff film among her late husband's belongings, and she wants Welles to determine if the movie is real or fake. Welles heads to California, where a video store employee (Joaquin Phoenix) helps him infiltrate the dangerous and depraved world of illegal porn movies.", Year = 1999, IsForeign = false, Length = "123min", Rating = "3.2/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube," },
                new Movie {Id = 104, DirectorId = 75, GenreId = 3, Title = "Bad Times at the El Royale", Description = "The El Royale is run-down hotel that sits on the border between California and Nevada. It soon becomes a seedy battleground when seven strangers -- a cleric, a soul singer, a traveling salesman, two sisters, the manager and the mysterious Billy Lee -- converge on a fateful night for one last shot at redemption before everything goes wrong.", Year = 2018, IsForeign = false, Length = "142min", Rating = "3.5/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube," },
                new Movie {Id = 105, DirectorId = 76, GenreId = 3, Title = "Murder by Death", Description = "Five diverse, infamous private eyes, including Sam Diamond (Peter Falk), Sidney Wang (Peter Sellers) and Jessica Marbles (Elsa Lanchester), are invited to the mysterious Lionel Twain's castle for a dinner party. There, they are told that Twain plans an unsolvable murder in the house at midnight -- and he will pay $1 million to the one who determines the killer. But when Twain's blind butler, Bensonmum (Alec Guinness), dies long before the deadline, the stakes go up for the trapped sleuths.", Year = 1976, IsForeign = false, Length = "103min", Rating = "3/5", Rated = "PG", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube," },
                new Movie {Id = 106, DirectorId = 77, GenreId = 8, Title = "Minority Report", Description = "Based on a story by famed science fiction writer Philip K. Dick, \"Minority Report\" is an action-detective thriller set in Washington D.C. in 2054, where police utilize a psychic technology to arrest and convict murderers before they commit their crime. Tom Cruise plays the head of this Precrime unit and is himself accused of the future murder of a man he hasn't even met.", Year = 1978, IsForeign = false, Length = "145min", Rating = "4.8/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Roku Channel, Paramount,  Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox" },
                new Movie {Id = 107, DirectorId = 1, GenreId = 3, Title = "Side Effects", Description = "For four years, Emily Taylor (Rooney Mara) has awaited the release of her husband, Martin (Channing Tatum), from being imprisoned for insider trading. Finally, Martin comes home, but Emily feels just as bad as she did when he was incarcerated, and she sinks into a deep depression. After her failed suicide attempt, psychiatrist Jonathan Banks (Jude Law) prescribes a series of medications. When those don't work, he gives Emily a new medication -- but the drug leads to ruined lives and death.", Year = 2013, IsForeign = false, Length = "106min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Roku Channel, Paramount,  Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox, Max, Hulu, Showtime, FuboTV, Sling TV" },
                new Movie {Id = 108, DirectorId = 71, GenreId = 3, Title = "Fracture", Description = "Willy Beachum (Ryan Gosling), a hotshot prosecutor, is about to leave his post for a lucrative job at a private law firm when his boss (David Strathairn) hands him a seemingly open-and-shut case. Ted Crawford (Anthony Hopkins) tried to kill his wife with a shot to the head and is defending himself in court. All hope for a quick and easy trial fly out the door when Ted proves to be a more cunning and devious adversary than Willy anticipates.", Year = 2007, IsForeign = false, Length = "103min", Rating = "4.3/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox" },
                new Movie {Id = 109, DirectorId = 1, GenreId = 1, Title = "Friday", Description = "yadadad", Year = 1978, IsForeign = false, Length = "103min", Rating = "4/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Netflix, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox" },
                new Movie {Id = 110, DirectorId = 79, GenreId = 3, Title = "High Crimes", Description = "A happily married, successful lawyer (Ashley Judd) is shocked to learn that her husband (Jim Caviezel) has a hidden past as a classified military operative, and is accused of committing a heinous war crime. As she prepares to defend her husband in a top-secret military court, where none of the rules she knows so well apply, she gets help from a wild card (Morgan Freeman) -- a former military attorney who doesn't play by anyone's rules.", Year = 2002, IsForeign = false, Length = "115min", Rating = "3/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube," },
                new Movie {Id = 111, DirectorId = 1, GenreId = 3, Title = "Along Came a Spider ", Description = "A psychological suspense thriller adapted from James Patterson's first highly acclaimed novel in the Alex Cross series, Morgan Freeman reprises his role as the Washington, D.C. police detective and psychologist who is through playing mind games with criminals -- that is until a methodical predator, Gary Soneji (Michael Wincott) commits a daring kidnapping and lures Cross into the case.", Year = 2001, IsForeign = false, Length = "104min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube," },
                new Movie {Id = 112, DirectorId = 1, GenreId = 3, Title = "Kiss the Girls", Description = "Successful forensic psychologist Alex Cross (Morgan Freeman) discovers that his niece has gone missing. Once he consults with police Detective Nick Ruskin (Cary Elwes), Cross believes that the disappearance is the work of an insane killer known as \"Casanova.\" Meanwhile, Dr. Kate McTiernan (Ashley Judd) is kidnapped by this criminal and witnesses many other imprisoned women in his lair. After narrowly escaping, McTiernan teams up with Cross to try to apprehend the deranged Casanova.", Year = 1978, IsForeign = false, Length = "115min", Rating = "3.5/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube," },
                new Movie {Id = 113, DirectorId = 82, GenreId = 3, Title = "Under Suspicion", Description = "\"Under Suspicion\" is an intense, psychological thriller, with veteran Police Captain Victor Benezet squaring off against prominent tax attorney Henry Hearst -- two life-hardened and well-matched opponents motivated by reasons more complex and personal than the pursuit of duty or the defense of reputation. Exploring the darkest recesses of the human imagination, bringing to light the dangerous psychological ramifications of a guilty conscience.", Year = 2000, IsForeign = false, Length = "111min", Rating = "3/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube," },
                new Movie {Id = 114, DirectorId = 83, GenreId = 3, Title = "Now You See Me", Description = "Charismatic magician Atlas (Jesse Eisenberg) leads a team of talented illusionists called the Four Horsemen. Atlas and his comrades mesmerize audiences with a pair of amazing magic shows that drain the bank accounts of the corrupt and funnel the money to audience members. A federal agent (Mark Ruffalo) and an Interpol detective (Mélanie Laurent) intend to rein in the Horsemen before their next caper, and they turn to Thaddeus (Morgan Freeman), a famous debunker, for help.", Year = 2013, IsForeign = false, Length = "103min", Rating = "3.8/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube," },
                new Movie {Id = 115, DirectorId = 84, GenreId = 1, Title = "Now You See Me 2", Description = "After fleeing from a stage show, the illusionists (Jesse Eisenberg, Woody Harrelson) known as the Four Horsemen find themselves in more trouble in Macau, China. Devious tech wizard Walter Mabry (Daniel Radcliffe) forces the infamous magicians to steal a powerful chip that can control all of the world's computers. Meanwhile, vengeful FBI agent Dylan Rhodes (Mark Ruffalo) hatches his own plot against Thaddeus Bradley (Morgan Freeman), the man he blames for the death of his father.", Year = 2016, IsForeign = false, Length = "139min", Rating = "3/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Tubi" },
                new Movie {Id = 116, DirectorId = 85, GenreId = 3, Title = "Gone Baby Gone", Description = "In a tough Boston suburb, private detective Patrick Kenzie is hired to trace the missing daughter of Helene McCready. Police chief Doyle doesn't think Patrick has a chance as she's been missing for 76 hours already. Patrick recognises the threat from molester Corwin Earle and Haitian gangster Cheese, but in a neighbourhood where he's lived all his life, the real danger may be closer to home.", Year = 2007, IsForeign = false, Length = "114min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Roku Channel, Paramount,  Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox, Max, Hulu, Showtime" },
                new Movie {Id = 117, DirectorId = 1, GenreId = 3, Title = "The Negotiator", Description = "Danny Roman (Samuel L. Jackson) is considered the best police hostage negotiator in Chicago. After a friend warns him that someone is embezzling from a disability fund, the person is found dead. Internal affairs investigator Niebaum (J.T. Walsh) discovers the gun used had been handled by Roman. When no one believes his innocence, Roman takes Niebaum hostage. When Chris Sabian (Kevin Spacey) arrives to hear Roman's demands, the two skilled negotiators begin a tense stand-off.", Year = 1998, IsForeign = false, Length = "130min", Rating = "5/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Netflix, Plex, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube," },
                new Movie {Id = 118, DirectorId = 86, GenreId = 3, Title = "Hostage", Description = "After one of his hostage negotiations goes awry, LAPD officer Jeff Talley (Bruce Willis) quits the force and relocates his family to the suburbs. As the sheriff in a sleepy town, Jeff thinks he has escaped the hustle and bustle -- until an elaborate local heist puts him back in the center of a hostage situation. When his own family is pulled into the fray, Jeff is forced to decide whether he should try to help the hostages or follow the criminals' hands-off mandate to protect his own family.", Year = 2005, IsForeign = false, Length = "113min", Rating = "3/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Pluto, Philo, Sling TV" },
                new Movie {Id = 119, DirectorId = 1, GenreId = 1, Title = "Friday", Description = "An airplane bearing gruff U.S. Marshal Sam Gerard (Tommy Lee Jones) crashes in the wilderness. On board the same flight is Mark Sheridan (Wesley Snipes), a federal prisoner accused of double murder, who escapes during the ensuing chaos, but not before rescuing several people from the wreckage. Gerard is ordered to hunt down the fugitive along with State Department agent John Royce (Robert Downey Jr.), and the two pursue Sheridan relentlessly, despite growing doubts about his guilt.", Year = 1998, IsForeign = false, Length = "131min", Rating = "4.3/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Pluto, Philo, Sling TV" },
                new Movie {Id = 120, DirectorId = 73, GenreId = 3, Title = "Out of Time", Description = "Matt Lee Whitlock (Denzel Washington) is the police chief of a small Florida town, going through a divorce with his detective wife, Alex (Eva Mendes). He begins a passionate affair with Ann (Sanaa Lathan), only to find out that she's stricken with terminal cancer. Matt steals a large sum of money confiscated from a drug bust in order to pay for Ann's treatment -- but when she apparently dies in a suspicious fire, the money disappears, and all the clues point to Matt as the culprit.", Year = 2003, IsForeign = false, Length = "105min", Rating = "4.3/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = " Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox, Max, Hulu" },
                new Movie {Id = 121, DirectorId = 87, GenreId = 3, Title = "The Glass House", Description = "After the parents of Ruby (Leelee Sobieski) and her younger brother, Rhett (Trevor Morgan), are killed in a car crash, their parents' best friends, Erin and Terry Glass (Diane Lane, Stellan Skarsgard), become their guardians. The children hear promises of a world of opulence and California fun -- all they have to do is move into the Glasses' gated house. Before very long, though, Ruby suspects that Erin and Terry may not be the ideal guardians they seemed to be.", Year = 2001, IsForeign = false, Length = "111min", Rating = "3.3/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube" },
